import React from 'react';
import './App.css';

import {useQuery} from '@apollo/react-hooks';
import {gql} from 'apollo-boost';

function App() {

  return (
    <h1>App</h1>
  );
}

const IS_LOGGED_IN_QUERY = gql`
  {
    isLoggedIn @client
  }
`;


export default App;
